var state = {
  display: "none",
  position: "absolute",
};

var visibleFor = 0;

var stateToStyle = function (state) {
  var result = "";
  for (var key of Object.keys(state)) {
    var value = state[key];
    result += `${key}: ${value}; `;
  }
  return result;
};

var image = document.createElement("img");
image.width = 256;
image.style = stateToStyle(state);
image.src =
  "data:image/png;base64,";
document.body.appendChild(image);

setInterval(function () {
  if (visibleFor > 0) {
    visibleFor--;
    state.display = "block";
    state.left = Math.floor(Math.random() * window.innerWidth) + "px";
    state.top = Math.floor(Math.random() * window.innerHeight) + "px";
  } else {
    state.display = "none";
  }
  image.style = stateToStyle(state);
}, 1000 / 24);

var input = document.querySelector("input[name=q][type=text]");
input.addEventListener("input", function (event) {
  visibleFor = event.target.value.length;
});
